import React, { useEffect, useState } from "react";
const AdvicePage = () => {
  const [data, setData] = useState();

  useEffect(() => {
    const getData = async () => {
      const responseData = await fetch("/api/advice").then(res => res.json());
      setData(responseData);
    };

    getData();
  }, []);

  console.log(data);

  return (
    <div>
      {data.map(advice => (
        <div key={advice.id}>advice?.advice</div>
      ))}
    </div>
  );
};

export default AdvicePage;
